(1, 'Queremos ciudadanos emprendedores con educación de clase mundial', 'Brindar educación de calidad, para lo cual destinará el 6 por ciento del PBI.', 1, 2),
(2, '', 'Desburocratizar el Estado y modernizarlo, institucionalizar la carrera pública y llevar adelante una gran reforma encabezada por el Ceplan, cuyo titular tendrá rango de ministro.', 1, 2),
(3, '', 'Resucita el Consejo Nacional de Descentralización e instituir la muerte civil para funcionarios sentenciados por corrupción.', 1, 2),
(4, '', 'Drástica reducción de los índices de delincuencia y violencia social, e implementación de una justicia rápida y efectiva para castigar a los delincuentes.', 2, 2),
(5, '', 'Romper la política de impunidad delictiva, ejecutar un programa de modernización y mejoramiento de comisarías con tecnología de punta y programas de capacitación a los 130 mil efectivos policiales con el fin de profesionalizar a la Policía Nacional', 2, 2),
(6, 'Maestros comprometidos con buena enseñanza', 'Priorización de políticas que mejoren las capacidades de enseñanzaProgramas de entrenamiento enfocados en el currículo escolarMejoramiento de la política remunerativaBecas para estudiantes que luego enseñen en escuelas públicas', 1, 3),
(7, 'Evaluando el aprendizaje', 'Continuación y mejoramiento de evaluación a los maestrosEvaluaciones por resultados', 1, 3),
(8, 'Enseñanza con contenidos de calidad', 'Adaptación de currículos, entrenamiento y textos a cada región.', 1, 3),
(9, 'Enseñanza que ayude a nuestros jóvenes a conseguir empleo', 'Adaptación de currículos secundarios a las demandas laborales de cada regiónIncorporación de cursos electivos para competencias laborales', 1, 3),
(10, 'Equiparando las oportunidades de nuestros jóvenes', 'Programa de becas para estudiantes que laboren después para el Estado', 1, 3),
(11, 'Educando niños con valores', 'Inclusión de valores en el currículo escolar con con contenidos sobre libertad, tolerancia, solidaridad, cultura, y protección ambiental', 1, 3),
(12, 'Internet para todos, información para aprender más y mejor', 'Interconexión total de nuestras escuelas', 1, 3),
(13, ' Niños bien alimentados y sanos, preparados para aprender más y mejor', 'Desayuno y Almuerzo Escolar en las escuelas de los pueblos más pobres del país.', 1, 3),
(14, 'Sistema de Información para la Gerencia de la Salud', 'Sistema de Información que identificará incidencias y atenciones para cada segmento', 3, 3),
(15, 'Ministerio de Salud que promotor de objetivos y metas nacionales', 'Metas nacionales de salud monitoreadas por el MINSA', 3, 3),
(16, 'Expandiremos el Seguro Integral de Salud.', 'Planes garantizados de prestación de servicios de saludConsolidación de un SIS sostenible', 3, 3),
(17, 'Consolidación Comités Locales de Administración de Salud (CLAS)', 'Comunidad organizada dirigirá y supervisará prestación de servicios básicos de salud', 3, 3),
(18, 'Más Médicos y enfermeras para los más necesitados', 'Incentivos económicos para profesionales que atiendan en áreas rurales y pobres', 3, 3),
(19, 'Por un mejor control de la calidad de las medicinas', 'Fortalecimiento de funciones supervisoras y sancionadoras de la DIGEMIDElevación de las sanciones penales a los falsificadores de medicinas', 3, 3),
(20, 'Acceso al crédito para construcción, ampliación y mejoramiento de viviendas', 'Otorgamiento créditos para construcción y mejoramiento a través de MIVIVIENDAApoyo a los municipios en identificación de áreas de expansión urbana', 5, 3),
(21, 'Ejecución de programas de vivienda para los más necesitados', 'Programa de lotes de vivienda con módulos y servicios básicosSistema de focalización coordinado con el de la red de protección social', 5, 3),
(22, 'Culminación de titulación urbana', 'Retorno de la meritocracia a COFOPRIReingeniería de los procesos empleados por COFOPRI', 5, 3),
(23, 'Agua y saneamiento para más peruanos', 'Incrementar como mínimo la cobertura a nivel nacional al 83%', 5, 3),
