(25, 'Ofensiva contra la corrupción', 'Ley que defina conflictos de interés del funcionario público', 8, 3),
(26, 'Plan con metas de todos y para todos los peruanos', 'plan de Desarrollo Nacional con objetivos y metas para los 5 años de gobiernoConjunto de metas e indicadores para medir logros del Estado', 8, 3),
(27, 'Presupuesto alineado a resultados del Plan', 'Profundización del presupuesto basado en resultados.', 8, 3),
(28, 'Metas nacionales para todos los niveles de gobierno', 'Monitoreo de metas específicas de gobiernos regionales y municipales.', 8, 3),
(29, 'Fortalecimiento de la gerencia y la inversión en regiones y municipios.', 'Apoyo a la profesionalización en regiones y municipios', 8, 3),
