(31, '', 'Acceso universal al internet y recursos educativos de calidad', 1, 1),
(32, '', 'Inversión sin precedentes en infraestructura educativa', 1, 1),
(33, '', 'Bonos de 300 soles mensuales para estudiantes', 1, 1),
(34, '', 'Estrategia 360° para combatir la delincuencia desde la raíz', 2, 1),
(35, '', 'Cadena perpetua sin beneficios para los crímenes más graves', 2, 1),
(36, '', 'Revolución tecnológica en las fuerzas policiales y militares', 2, 1),
(40, '', 'Fomentaremos el empoderamiento e independencia económica de las mujeres', 5, 1),
(41, '', 'Crearemos el "Fondo Comunal a la vena" para mejorar las inversiones en desarrollo humano', 5, 1),
(42, '', 'Potenciaremos el SIS para dar una salud de calidad a todos los peruanos', 5, 1),
(43, 'Mejoramiento de logros de aprendizaje', 'Fomentar la participación de la comunidad educativa y de forma especial de los padres y madres de familia para que sean copartícipes en contribuir a mejorar la educación de sus hijos e hijas articulando el que hacer de la escuela con el hogar', 1, 4),
(44, 'Mejorar la capacidad de los estudiantes\r\npara aprender', ' Declaramos prioritaria la atención de la primera infancia porque necesitamos Infantes bien nutridos para tener niños y adolescentes bien educados para la empleabilidad y la ciudadanía.', 1, 4),
(45, 'Mejorar las condiciones para el aprendizaje', 'Brindar acceso a Internet a todas las instituciones educativas públicas del país con la implementación de pisos tecnológicos necesarios para facilitar la conectividad', 1, 4),
(46, 'Mejoramiento de las condiciones de trabajo y de las capacidades de los docentes', 'Revaloración de la carrera magisterial con docentes capacitados y motivados con incentivos económicos e incorporación progresiva a la meritocracia a nivel nacional.', 1, 4),
(47, 'Otros objetivos importantes', 'Construir 100 nuevos Colegios Emblemáticos en las provincias del país.', 1, 4),
(48, 'Acciones inmediatas', 'Decisión política de conducir a nivel presidencial una enérgica acción contra la delincuencia en defensa de la ciudadanía.Reestructuración de la policía por medio de una misión extranjera con cooperación de expertos nacionales.Duplicar de inmediato el personal policial comprando el día libre y eliminando el 24 x 24, sin restarle ingresos al personal policialParticipación de las FFAA como apoyo a la PNP en la Seguridad Ciudadana', 2, 4),
(49, 'Un enfoque integral', 'Entender a la seguridad ciudadana como un bien común y por tanto un bien de orden público. ', 2, 4),
(50, 'Objetivos Específicos', 'Desarrollar una gestión sostenible y eficiente del recurso hídrico en cuencas y reducir los niveles de contaminación   Reducir los niveles de contaminación del aire.', 6, 4),
(51, 'Promover el empleo productivo', 'Fortalecer el sector exportador desarrollando un mayor valor agregado mediante el otorgamiento de incentivos. ', 5, 4),
(52, 'Mejoras en los sistemas de pensiones', 'Mejorar las pensiones a los jubilados de la ley 19990.', 5, 4),
(53, 'Promover el empleo digno y decente', 'Promover en el sector empleador el respeto de los derechos fundamentales de los trabajadores, en cuanto a sindicación y negociación colectiva.Impulsar acciones positivas de no discriminación y eliminación de las peores formas de trabajo: Trabajo forzoso y Trabajo Infantil. Promover la negociación colectiva y otras formas de solución a los conflictos laborales, en el sector público y privado.', 5, 4),
(54, 'Promover los sistemas y procedimientosde beneficios para la formmalización laboral', 'Establecer un régimen de incentivo para aquellas MYPES que incorporen trabajadores al régimen general.', 5, 4),
(55, 'Fortalecer la capacidad operativa del sistema de inspección del trabajo', 'Priorizar el registro obligatorio de trabajadores en planilla - PLAN RETO', 5, 4),
(56, 'Fortalecer la seguridad y salud en el trabajo', ' Tipificar como delito el no reporte o el proporcionar información falsa respecto de accidentes de trabajo con la finalidad de evadir responsabilidades.', 5, 4),
(57, 'Promover el acceso al a justicia laboral', 'Crear un procedimiento especial de reclamación de beneficios económicos de los trabajadores menores a 3 UIT a ser resueltas en audiencia única a llevarse a cabo dentro de los 30 días de presentada la demanda. La apelación será admisible únicamente si el demandado deposita por lo menos el 30% del monto sentenciado.En casos de desnaturalización de contratos modales y/o locación de servicios a pedido del demandante, ante la concurrencia de elementos característicos de una relación laboral el juez dictará medida cautelar para la continuación de la prestación de servicios hasta la conclusión del proceso.', 5, 4),
(58, 'Promover la productividad y competitividad', 'Impulsar en los próximos 5 años el aumento de la educación terciaria del 40% a un 50% en el sector emprendedor.', 5, 4),
(59, 'Promover el acceso a la seguridad Social', 'Implementar un sistema de pensiones sociales para los emprendedores, extensivo al núcleo familiar', 5, 4),
(60, 'Promover el desarrollo empresarial ', 'Creación de centros productivos parques industriales vinculados a CITES  Acceso a crédito  capital semilla, apoyando proyectos que hayan identificado una clara oportunidad de mercado.', 5, 4),
(61, 'Servicios básicos: agua, desagüe y electricidad', 'Generar condiciones para una ágil y eficiente inversión en agua, saneamiento y electricidad.', 5, 4),
(62, 'Acciones estratégicas', 'Generar condiciones para una ágil y eficiente inversión y gasto en salud.', 3, 4),
(63, 'Creación de la Agencia de Sociedad de la Información', 'Como entidad articuladores de políticas y regulación en la materia, permitiendo que se incorporen componentes de TICs para el Desarrollo (TICpD) o políticas digitales en todas las Políticas de Estado. ', 7, 4),
(64, '#Internet Libre para Todos ', 'Los espacios públicos contarán con una red inalámbrica para permitir el acceso a internet, para que la información fluya y permitir el libre acceso a la información. De igual manera se establecerán puntos de carga de electricidad en los diversos parques y espacios públicos. ', 7, 4),
(65, 'Monitoreo contra la Inseguridad 360º', 'Crearemos un nuevo centro de monitoreo público con cámaras para combatir la delincuencia. Esta red será capaz de conectarse con redes ya establecidas y con la Policía Nacional ', 7, 4),
(66, 'Sistema de Alerta en caso de desastres', 'Consistirá en el nuevo Centro de Control de Emergencia Digital, interconectado a la Red del INDECI y capaz de enlazarse con zonas de impacto, para hacer frente a desastres naturales, que pueden afectar a nuestra población, incluyendo el envió de información a través de móviles y diversas plataformas de información.', 7, 4),
(67, 'Postas Médicas y Comisarías Conectadas', 'En los primeros 100 días se desplegara conectividad en todas las comisarías y postas médicas para servir a la población de una manera más eficiente y efectiva. ', 7, 4),
(68, '', 'Implentar unidades policiales capacitadas para la lucha contra el crimen organizado, apoyando los esfuerzos del poder judicial y del ministerio público en el funcionamiento de juzgados y fiscalías', 2, 5),
(69, '', 'Aumento de suelto, empezando con un aumento general de 15 a 20%, pensionable (las gratificaciones no pensionables del pasado son causa del deficit de las pensiones)', 2, 5),
(70, '', 'Penas mucho mas severas a los jueces, fiscales y policias corruptos', 2, 5),
(71, '', 'Eliminación de penas, permisivas como el "2x1", celulares en cárceles, etc. "Estás dentro y allí sigues hasta que te portes bien"', 2, 5),
(72, '', 'Aplicar programas focalizados a jóvenes en risgo: centros juveniles deportivos en todos los barrios pobres, con entrenadores y educación cívica; programas de trabajo y entrenamiento juvenil en actividades ambientales, y forestación y limpieza urbana como ejemplos.', 2, 5),
(73, '', 'Completa reforma del regimen penitenciario y ensayar nuevas cárceles privatizadas, con programas de aprendizaje y educación', 2, 5),
(74, '', 'Necesitamos mas policias (Hoy tenemos menos de 10000 con un régimen de trabajo variable) y más serenos, sobre todo en las zonas pobres de las ciudades, que son las más inseguras', 2, 5),
(75, '', 'Aumento de salarial general para todos los maestros, que debe ir acompañado de un entrenamiento intensivo para que mejoren sus conocimientos y técnicas pedágogicas', 1, 5),
(76, '', 'Reorientar las forma de educar en vez de la memorialización de hoy a un sistema que enseñe a los jovenes a pensar y resolver problemas. En un mundo cambiante, lo mas importante es saber adaptarse', 1, 5),
(77, '', 'Fortalecer la calidad de la enseñanza e investigación en las grandes universidades del estado - particularmente San Marcos, la Universidad Nacional de Ingeniería, y la Agraria. Eso ayudara a levantar el novel de todo el sistema universitario en vez de las leyes complicadas que se han promulgado recientemente.', 1, 5),
(78, '', 'Promover la deducación pública integral para los más jóvenes empezar con un desayuno completo(hoy no lo hay), para los más grandes educación cívica con centros de esparcimiento y deporte controlados por profesores y entrenadores', 1, 5),
(79, '', 'Organizar colegios tecnológicos de primera calidad en cada región del Perú con directores del sector privado (para orientar a los jóvenes hacia trabajos remunerativos), internados para los que vienen de provincias, y acreditación para poder seguir estudios universitarios. Es un sistema que ha dado buenos resultados en Alemania, hoy la economía mas exitosa de Europa.', 1, 5),
(80, '', 'Legislación que declare en emergencia las empresas de saneamiento, que hoy pierden un promedio de mas de 40% del agua que procesan, para que los usuarios que pagan sus facturas a tiempo reciban un descuento y una partipación accionaria.', 5, 5),
(81, '', 'Establecer una politica integral del agua y del saneamiento, empezando por la forestación de las altas cuencas, la conservación y reservorios en los ríos de la costa, y un sistema que evite el dispendio en el uso de las aguas de regadío, con consecuencias como la salinización de la tierra y el hundimiento de las napas freáticas de la costa', 5, 5),
(82, '', 'Los beneficios de un programa de este tipo serían inmensos no sólo para los usuarios sino también para la actividad económica que se generaría. Calculamos que la inversión costaría, a los precios de hoy, entre $10000 y $15000 millones en los proximos diez años, una suma que podría pagarse en parte con los ahorros de agua que actualmente pierden las empresas publicas de saneamiento, todas ellas poco eficientes', 5, 5),
(83, '', 'Implementar un solo servicio de salud pública, con una sola escala de sueldos para los médicos y enfermeras del sector público, actualmente mal remunerado, y debería evitarse la duplicidad a las compras de equipos y medicamentos que tiene el estado. los ahorros resultantes nos permitirían invertir en mejorar los hospitales y puestos de salud, muchos de los cuales hoy funcionan de manera intermitente o a veces no funcionan', 3, 5),
(84, '', 'Facilitar que las cooperativas, bien gerenciadas, sean sujetas de créditos y tengan acceso a servicios técnicos: semilla mejorada, tecnicas de cultivo, información sobre los mercados, sistemas de almacenaje, y todos los otros aspectos que permitirían modernizar la agricultura.', 6, 5),
(85, '', 'Mejorar la infraestructura: vías de comunicación, electrificación, torres para los teléfonos celulares', 6, 5),
(86, '', 'Implementar un marco institucional y una ley que promueva en el periodo 2016-21 la forestación de 2 millones de hectáreas en la sierra y 1.5 millones reforestadas en la amazonía.', 6, 5),
(87, '', 'Paso obligado de los altos funcionarios del servicio administrativo del estado por las regiones y grandes municipales ', 5, 5),
(88, '', 'Presencia fisica del Ministerio de Economía (MEF) en todas las regiones para promover proyectos viable de infraestructura (riego, carreteras, hospitales, agua potable, colegios) en colaboración con los gobiernos regionales y locales y otros ministerios. Es la única forma de evitar el uso ineficaz del tan discutido "SNIP" y las demoras excesivas en los proyectos.', 5, 5),
(89, '', 'Darle a las autoridades locales y regionales la capacidad para resolver localmente problemas administrativos de los ciudadanos (por ejemplos casos médicos, pensiones de viudez) que ahora se "mandan Lima"', 5, 5),
(90, '', 'Promover que cada región prepare cada cuatro años un plan de inversiones publicas y de concesiones (estas últimas en coordinación con Proinversión), establecer con el MEF un sistema de control de ejecución y un mecanismo de revisiones anuales ', 5, 5),
(91, '', 'Ningún jubilado ganará menos del sueldo mínimo. ', 5, 2),
(92, '', 'Programar e implementar servicios de salud para la atención oportuna del nuevo perfil epidemiológico.', 3, 4),
(93, '', 'Asignar recursos presupuestales que permitan cerrar las brechas en salud.', 3, 4),
(94, '', 'Programa de Vacunación nacional para proteger la salud de la población', 3, 4),
(95, '', 'Solución quirúrgica gratuita para personas mayores con cataratas. ', 3, 4),
(96, '', 'Tratamiento intensivo para enfermos de Tuberculosis TBC', 3, 4),
(97, '', 'Prevención contra el dengue, chikunguya, varicela y sarampión que pueden agudizarse por el fenómeno de El Niño.', 3, 4),
(98, '', 'Intenso programa gratuito de salud dental.', 3, 4),
(99, '', 'Apoyo del Estado a programas de salud mental, desprotegido totalmente.', 3, 4),
(100, '', 'Apoyo a programas contra el cáncer y el virus de la inmunodeficiencia humana (HIV)  Compromiso del Estado con personas con discapacidad, en tratamiento y opciones laborales. ', 3, 4),
(101, '', 'Diseñar e implementar programas de capacitación y actualización para los profesionales y técnicos de la salud. ', 3, 4),
(102, '', 'Estandarizar plataforma informática (historia clínica virtual).', 3, 4),
(103, '', 'Implementar una Red Nacional Integrada de Servicios de Emergencias y Urgencias.', 3, 4),
(104, '', 'Promover las Unidades de Atención Primaria Integradas e implementar Brigadas Itinerantes de Atención Primaria de Salud, para poblaciones en condición de vulnerabilidad.', 3, 4),
(105, '', 'Fomentar la buena alimentación, nutrición y la actividad física en todas las regiones del país, como base de una comunidad saludable.', 3, 4),
(106, '', 'Implementar mecanismos efectivos y eficientes de abastecimiento.', 3, 4),
(107, '', 'Crear la Red Nacional Integrada de Telemedicina y Telesalud  Desarrollar investigación, desarrollo tecnológico e innovación (I+D+i) especializada en materia de Salud y Medicina ', 3, 4),
(108, '', 'Incrementar el financiamiento del Seguro Social de Salud (ESSALUD).', 3, 4),
(109, '', 'Aumentar progresivamente el monto per cápita asignado al Seguro Integral de Salud (SIS).', 3, 4),
(110, '', 'Mejorar las condiciones para las atenciones de crecimiento y desarrollo de las niñas y niños de hasta cinco años de edad, mediante la participación en programas de: complementación alimentaria, vacunación completa, desparasitación, entrega de suplementos vitamínicos, y utilización de pastillas de cloro para potabilizar', 3, 4),
(111, '', 'Implementar mecanismos efectivos y eficientes de abastecimiento.', 3, 4),
(112, '', 'Asegurar niveles suficientes de inversión pública en servicios básicos', 5, 4),
(113, '', 'Desarrollar Programas que fomenten la cultura sanitaria. ', 5, 4),
(114, '', 'Implementar un Programa para la gestión eficiente y sostenible de los recursos hídricos en el país, que contemple el análisis costo beneficio y la evaluación de riesgos  ', 5, 4),
(115, '', 'Implementar programas de capacitación sobre regulacion de recursos hídricos.', 5, 4),
(116, '', 'Simplificar trámites ante la Autoridad Nacional del Agua (autorización de vertimientos y uso del agua)', 5, 4),
(117, '', 'Fortalecer la Gestión empresarial de las Empresas Prestadoras de Saneamiento', 5, 4),
(118, '', 'Proponer e implementar mecanismos de coordinacion entre entidades públicas, para agilizar la ejecución de proyectos de inversión del sector saneamiento.', 5, 4),
(119, '', 'Integrar y consistenciar el marco jurídico sobre los recursos hídricos. ', 5, 4),
(120, '', 'Entrega de libros a los alumnos para que lean en sus hogares.', 1, 3),
(122, '', 'Implementar en todas las instituciones educativas las aulas de refuerzo escolar en horarios alternos con una estrategia de modelos flexibles de atención a fin de que ningún niño o niña se quede sin estudiar', 1, 4),
(123, '', 'Promover la elaboración de un diseño curricular contextualizado y acorde a cada región con un currículo flexible y pertinente orientado a las necesidades del Perú del 2021', 1, 4),
(124, '', 'Impulsar colegios secundarios con variante técnico productiva según regiones y acorde a su realidad económica y social', 1, 4),
(125, '', ' Implementar progresivamente la Jornada Escolar Completa en todos los colegios (50 horas pedagógicas semanales), así como la enseñanza del idioma inglés en escuelas públicas para que al 2021 los estudiantes egresen con nivel B1 del Marco Común Europeo de referencia para las lenguas y los docentes alcancen el nivel C1.', 1, 4),
(126, '', 'Rediseño total de la educación técnica', 1, 3),
(127, '', 'Participación de universidades acreditadas ante el Ministerio de Educación', 1, 3),
(128, '', 'Simplificar trámites y procedimientos para la participación en sistema de compras estatales.', 5, 4),
(129, '', 'Efectivizar el sistema de acceso a seguridad social en salud y en pensiones sociales para los trabajadores de las MYPES con el cofinanciamiento del Estado.', 5, 4),
(130, '', 'contratación de 2,000 inspectores a nivel nacional para efectos de impulsar el PLAN RETO', 5, 4),
(131, '', 'Establecer un sistema de gestión y seguridad y salud en el trabajo mínimo estandarizado aplicable a toda actividad económica, acorde a nuestra realidad.', 5, 4),
(132, '', 'Impulsar acciones para que los centros y lugares de trabajo sean sanos y seguros.', 5, 4),
(133, '', 'Constituir un fondo para la atención de accidentes de trabajo de los emprendedores que no cuenten con cobertura de seguridad social.', 5, 4),
(134, '', 'Impulsar un gran consenso o acuerdo nacional para el acceso a derechos laborales y seguridad social a millones de trabajadores que hoy no tienen más que una remuneración sin acceso a otros derechos ni a seguridad social.', 5, 4),
(135, '', 'Permitir el uso de una parte del fondo para la cuota inicial o adquisición de una vivienda, además, si lo pide el afiliado, recibirá hasta el 50% de su fondo al momento de la jubilación.', 5, 4),
(136, '', 'Comisión de las AFPs debe calcularse sobre el fondo y no sobre las pensiones de los aportantes.', 5, 4),
(137, '', 'Suspensión de la aplicación de nuevas tablas de mortalidad que reducen nuestras pensiones.', 5, 4),
(138, '', 'Devolución del 100% de los aportes de los fallecidos a los deudos.', 5, 4),
(139, '', 'Establecer legalmente la imprescriptibilidad de las deudas a la AFP por ser deudas previsionales y no civiles.', 5, 4),
(140, '', 'Ademas se declarará la responsabilidad penal de los empleadores que retienen y no cancelan las deudas; como ya existe en otros países, en los que hay pena privativa de libertad.', 5, 4),
(141, '', 'Establecer responsabilidad de las AFPs en el cobro de deudas de empleadores; muchas de estas han prescrito, por negligencias que deben ser sancionadas.', 5, 4),
